      nick: 'dapelu',
      subMonth: 3,
      avatar: 'https://i.pravatar.cc/150?u=dapelu',
      description: 'Dapeli hace de moderador'
    },
    {
      nick: 'sergio_serrano',
      subMonth: 7,
      avatar: 'https://i.pravatar.cc/150?u=sergio_serrano',
    }
  ])

  return (
    <div className="App">
      <h1>Subs</h1>
      <ul>
        {
          subs.map(sub => {
            <li key={sub.ke}>

            </li>
          })
        }
      </ul>
    </div>
  );
}

export default App;
